import headerNavBar from './List';
import CreateList from './CreateList';

export default function NavBar() {
    return (
        <div className="nav ">
            <ul className="flex flex-col on:visible 2xsm:invisible">{headerNavBar.map(CreateList)}</ul>
        </div>
    );
};
